(8, 126, 'Die Octopus hat eine L채nge von 126 m und wurde im Jahr 2003 an ihren Besitzer Paul Allen ausgeliefert. Die Yacht beherbergt zwei Hubschrauber in einem dazugeh철rigen Hangar, ein 19 m langes Beiboot sowie ein U-Boot f체r acht Personen. Seitenluken oberhalb der Wasserlinie dienen als Garage f체r kleinere Beiboote und Jetskis. Sie wurde von Espen ino Naval Architects entworfen und bei HDW in Kiel im Auftrag von L체rssen gebaut. Der Rumpf ist aus Stahl. Paul Allen nutzte die Yacht und die Ausr체stung zur Tiefseeerforschung im Jahr 2015, um nach dem Wrack des japanischen Superschlachtschiffes Musashi zu suchen, das im Zweiten Weltkrieg in der Sibuyan-See versenkt worden war. Anfang M채rz 2015 entdeckte Allen das Wrack in etwa 1.000 Metern Tiefe.', , 1, 'Octopus');
