INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(11, 147, 'Die Abdul Aziz ist eine der Mega-Yachten im Besitz der saudi-arabischen K철nigsfamilie. Sie war mit einer L채nge von 147 Metern bei Auslieferung die l채ngste und gr철te Motoryacht der Welt und behielt diesen Status f체r 22 Jahre, so dass sie heute als gr철te Luxusyacht des 20. Jahrhunderts gilt. Gebaut wurde sie 1984 als Maierform von der Helsing첩r V챈rft in D채nemark. Der erste Besitzer war der K철nig von Saudi-Arabien Fahd ibn Abd al-Aziz. Nach dessen Tod 2005 wird sein Halbbruder Abdullah ibn Abd al-Aziz als Besitzer angegeben, der das Schiff 체ber die Sulamith Management Inc. betreibt. Das 147 Meter lange Schiff hat eine Breite von 18,3 Metern und einen Tiefgang von 4,9 Metern. Es besitzt zwei 5816 kW Pielstick-Dieselaggregate f체r den Antrieb. Die Reisegeschwindigkeit betr채gt 18 Knoten, die Maximalgeschwindigkeit 22 Knoten. Die Yacht ben철tigt im Vollbetrieb eine 60- bis 65-k철pfige Besatzung. Innenausstatter war David Nightingale Hicks.', , 1, 'Prince Abdulaziz');
