INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(13, 133, 'Die Al Mirqab wurde 2004 in Auftrag gegeben. Entworfen wurde sie von Kusch Yachts, die Auenanlagen gestaltete Tim Heywood. Zu Beginn trug sie den Projektnamen Project May. Gebaut wurde die Yacht bei Peters Schiffbau im schleswig-holsteinischen Wewelsfleth. Der Bau dauerte vier Jahre und wurde von 700 Spezialisten aus ganz Europa durchgef체hrt. Nach ihrer Fertigstellung 2008 erfolgten die Testfahrten der Yacht in der Bucht vor Eckernf철rde bei Kiel. Bis die Panama Papers im Jahre 2016 die Hintergr체nde enth체llten, galt der ehemalige Emir von Katar, Hamad bin Chalifa Al Thani, als Eigent체mer. Aus den Panama Papers geht hervor, dass die Yacht f체r eine Briefkastenfirma namens Trick One Limited gebaut wurde, hinter der offenbar Hamad ibn Dschasim ibn Dschabir Al Thani steht. Die Inneneinrichtung wurde von Andrew Winch Designs entworfen. Die Yacht verf체gt 체ber einen Hubschrauberlandeplatz inklusive einer EC 155, einen Miniatur-Pool auf Deck, eine Bibliothek, ein Wellnessbereich, einen G채ste-Speisetisch, ein Herrenzimmer und ein Kino.', , 1, 'Al Mirqab');
